function App() {
  return (
    <div >
      <header >
       <a href="/">bitbasket</a>
      </header>
      <main>

        <h1>
          Healthy items
        </h1>
        <div className>
        {
          data.products.map(product => (
              <div key={product.slug}>
            <img src={product.image} alt={product.name} />
            <p>
              {product.name}
              {product.price}
            </p>
          </div>))
        }
        </div>
      </main>
    </div>
  );
}

export default App;
